const Form = () => {
  return (
    <form className={style}>
      <div>
        <label htmlFor="">Username: </label>
        <input type="text" />
      </div>
      <div>
        <label htmlFor="">Password: </label>
        <input type="text" />
      </div>
      <button></button>
    </form>
  );
};

export default Form;
